       const {name,email}=props;
return(
       <div className='flex flex-wrap ustify-content-center '>
       <div className='j bg-light-green dib tc br4 ma3' >
       <img alt='robots' src={`https://robohash.org/${props.id}`}/>
       <div>
        <h2> {name} </h2>
        <p> {email} </p>
        </div>
       </div>
       </div>
)
}

export default Card;
